       <div id="mainstory2" class="ni">
         <P>President Asif Ali Zardari has rejected India's demand to hand over LeT chief Hafiz Mohd Sayeed and other fugitives in the wake of Mumbai terror attacks and doubted whether the arrested terrorist is a Pakistani national.</P>

<P>Two days after New Delhi's demarche (protest note) demanding the handing over of 20 fugitives, Zardari made known Pakistan's reluctance to part with them.</P>
<P>"If we had proof, we would try them in our courts. We would try them in our land and we would sentence them," he said appearing on "Larry King Live" programme on CNN last night.</P>
<P>India's list of 20 most wanted criminals given to Pakistan included underworld don Dawood Ibrahim and Jaish-e-Mohammad chief Masood Azhar.</P>
<P>India is awaiting Pakistan's response before deciding on the options it could exercise. New Delhi's outrage was voiced by External Affairs Minister Pranab Mukherjee who said the country has every right to protect its territorial integrity and will take "appropriate action" as it feels necessary to deal with the terror strikes emanating from Pakistan.</P>
<P>The minister also did not rule out military strikes against terror camps in Pakistan.</P>
<P>Zardari said that he also doubted India's claim that the sole surviving gunman, who was captured by Indian security forces, was a Pakistani national.</P>
<P>"We have not been given any tangible proof to say that he is definitely a Pakistani. I very much doubt that he's a Pakistani," he said.<BR><BR>Zardari denied Pakistan's involvement in the attacks, saying the terror strikes were executed by the "Stateless actors" who wanted to hold the "entire world hostage."</P>
<P>"These (terrorists) are stateless actors who have been operating throughout the region. They include gunmen and the planners and are holding the entire world hostage," he said.</P>

<P>"State of Pakistan is not responsible for the attacks in Mumbai... Even the White House and the US intelligence agency CIA have said so," he said.</P>
<P>The President ruled out any possibility of Pakistan and India going to war, saying "democracies do not go to war". The three wars, India and Pakistan have fought, took place during dictatorships in Pakistan, he said.</P>
<P>Zardari said this is time to come together, do a joint investigation and look at the problem in the larger context.</P>
<P>"The threat is in the region and just not to Bombay or to India. The threat (also is) to the State of Pakistan. There's a threat to Afghanistan, It's a threat throughout region. So that would be counterproductive," he added.</P>
<P>"I'm a victim. The state of Pakistan is a victim. We are the victims of this war, and I am sorry for the Indians, and I feel sorry for them. I've seen this pain. I feel this pain every time I see my children. I can see it in their eyes. This pain lives with me because of my wife and what we are going through in Pakistan," he said. 
